    "definition": "( YTD, % ) Loans secured primarily by real estate, whether originated by the bank or purchased. A loan secured by real estate is a loan that, at origination, is secured wholly or substantially by a lien or liens on real property for which the lien or liens are central to the extension of the credit – that is, the borrower would not have been extended credit in the same amount or on terms as favorable without the lien or liens on real property. To be considered wholly or substantially secured by a lien or liens on real property, the estimated value of the real estate collateral at origination (after deducting any more senior liens held by others) must be greater than 50 percent of the principal amount of the loan at origination."
